DROP TABLE IF EXISTS paf_cities;

CREATE TABLE paf_cities (
  name varchar(255) NOT NULL,
  state_code varchar(255) NOT NULL,
  country_code varchar(4) NOT NULL DEFAULT '036',
  latitude decimal(10,8) DEFAULT NULL,
  longitude decimal(11,8) DEFAULT NULL,
  comments varchar(255) DEFAULT NULL
);

CREATE INDEX idx_cities_name_state_code_country_code ON paf_cities (name, state_code, country_code);
CREATE INDEX idx_cities_state_code ON paf_cities (state_code);
CREATE INDEX idx_cities_country_code ON paf_cities (country_code);
CREATE INDEX idx_cities_name ON paf_cities (name);
CREATE INDEX idx_cities_latitude_longitude ON paf_cities (latitude, longitude);

